sdfmean=nanmean(sdf,1);
sdfmean=sdfmean;
fKnalpha_1=fKnalpha(dpmean);
CondensationConstant=GR/nanmean(fKnalpha_1./dpmean);

% plot(Dp,sdfmean);
% set(gca,'Xscale','log');
% hold on

Dp_new=dpmean(end);
N_nuc_new=N_nuc(end);
Dp_growth=[];
i=1;
while Dp_new<73.7
    fKnalpha_new=fKnalpha(Dp_new);
    Dp_new=fKnalpha_new/Dp_new*CondensationConstant/60*5+Dp_new;
    Dp_growth(i)=Dp_new;
    i=i+1;
end

for i=1:1:length(Dp_growth)
    for j=1:1:length(Dp)
        coagulation_coefficient(i,j)=Coagulation_coeff(Dp_growth(i)*1e-9,Dp(j)*1e-9,1.83e3,1.83e3,298,1,1); % coag coeff's unit is cm3/s
    end
end
rate=sum(coagulation_coefficient.*sdfmean*mean(log10(Dp(2:end))-log10(Dp(1:end-1))),2)*300; % five minutes as time step

N_nuc_growth=[];
for i=1:1:length(Dp_growth)
    N_nuc_new=N_nuc_new-rate(i)*N_nuc_new;
    N_nuc_growth(i)=N_nuc_new;
end

