    ylabel('{\itD_p} (nm)');
    yticks([20 40 80 160 400]);
    ylim([0 400])
    set(gca,'TickDir','out');
    set(gca,'Yscale','log');
    hold on
    plot([1:1:length(dpmean)]*5/60,dpmean,'ok');

    alignplot=subplot(2,1,2);
    yyaxis left
    plot([1:1:length(N_nuc_growth)]*5/60,Dp_growth);
    ylabel('D_{p,nuc} (cm^{-3})');
    yyaxis right
    plot([1:1:length(N_nuc_growth)]*5/60,N_nuc_growth);
    ylabel('N_{Nuc} (cm^{-3})');
    xlabel('Time after observation (h)');

    pos1=get(sdfplot,'Position');
    pos2=get(alignplot,'Position');
    pos1(3)=pos2(3);
    set(sdfplot,'Position',pos1);
end

CCN=sum(sdfmean(48:end),2)*mean(log10(Dp(2:end))-log10(Dp(1:end-1)))
fraction=N_nuc_growth(end)/N_nuc_growth(1)